import React from 'react';
import Nav from '../components/Nav';

const Home = () => {
    return (
        <section id="home">
            <Nav />
            <div className="container">
                <div className="row">
                    <div className="landing__wrapper">
                        <div className="landing__description">

                        </div>
                        <button className="landing__btn">
                            EXPLORE
                        </button>
                    </div>
                </div>
            </div>
        </section>
    );
}

export default Home;
